import React, { useEffect, useState } from "react";
import api from "../api/axios";

export default function Dashboard() {
  const [leads, setLeads] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  const load = async () => {
    try {
      setLoading(true);
      const res = await api.get("/leads");
      setLeads(res.data);
    } catch (err) {
      setError("❌ Failed to load leads");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    load();
  }, []);

  // Delete lead
  const deleteLead = async (id) => {
    if (!window.confirm("Are you sure you want to delete this lead?")) return;
    try {
      await api.delete(`/leads/${id}`);
      setLeads(leads.filter((l) => l._id !== id));
    } catch (err) {
      alert("❌ Failed to delete lead");
    }
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      <h2 style={{ color: "#1e3a8a", marginBottom: "20px" }}>📊 Leads Dashboard</h2>

      {loading ? (
        <p>Loading...</p>
      ) : error ? (
        <p style={{ color: "red" }}>{error}</p>
      ) : (
        <table
          style={{
            width: "100%",
            background: "white",
            borderCollapse: "collapse",
            borderRadius: "12px",
            overflow: "hidden",
            boxShadow: "0 4px 12px rgba(0,0,0,0.05)",
          }}
        >
          <thead style={{ background: "#f3f4f6" }}>
            <tr>
              <th style={{ padding: "12px", textAlign: "left" }}>Name</th>
              <th style={{ padding: "12px", textAlign: "left" }}>Email</th>
              <th style={{ padding: "12px", textAlign: "left" }}>Phone</th>
              <th style={{ padding: "12px", textAlign: "left" }}>Agent</th>
              <th style={{ padding: "12px", textAlign: "left" }}>Created</th>
              <th style={{ padding: "12px", textAlign: "center" }}>Actions</th>
            </tr>
          </thead>
          <tbody>
            {leads.length > 0 ? (
              leads.map((lead) => (
                <tr key={lead._id} style={{ borderTop: "1px solid #e5e7eb" }}>
                  <td style={{ padding: "12px" }}>{lead.name}</td>
                  <td style={{ padding: "12px" }}>{lead.email}</td>
                  <td style={{ padding: "12px" }}>{lead.phone}</td>
                  <td style={{ padding: "12px" }}>{lead.agent?.name || "-"}</td>
                  <td style={{ padding: "12px" }}>
                    {lead.createdAt
                      ? new Date(lead.createdAt).toLocaleDateString()
                      : "-"}
                  </td>
                  <td style={{ padding: "12px", textAlign: "center" }}>
                    <button
                      onClick={() => deleteLead(lead._id)}
                      style={{
                        background: "#ef4444",
                        color: "white",
                        border: "none",
                        padding: "8px 12px",
                        borderRadius: "6px",
                        cursor: "pointer",
                        fontSize: "14px",
                      }}
                      onMouseOver={(e) =>
                        (e.currentTarget.style.background = "#dc2626")
                      }
                      onMouseOut={(e) =>
                        (e.currentTarget.style.background = "#ef4444")
                      }
                    >
                      ❌ Delete
                    </button>
                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <td
                  colSpan="6"
                  style={{
                    padding: "16px",
                    textAlign: "center",
                    color: "#6b7280",
                  }}
                >
                  No leads found
                </td>
              </tr>
            )}
          </tbody>
        </table>
      )}
    </div>
  );
}
